function MenuItem(){
    return <div>
        <div class="card" style={{width: 18 + 'rem'}}>
            <img class="card-img-top" src="https://images.pexels.com/photos/302888/pexels-photo-302888.jpeg?auto=compress&cs=tinysrgb&dpr=2&w=500" alt="Card image cap" />
            <div class="card-body">
                <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
            </div>
        </div>
    </div>
}

export default MenuItem;
